import React, {useState} from 'react';
import Navbar from './Navbar';
import Navbar_2 from './Navbar-2';
import Project from './Projects';
import ProjectDetails from './projectDetails';
import NewPage from './newPage';
import Login from './Login';
import AuthContext from './authContext';
import {Route, BrowserRouter as Router, Switch,Redirect} from 'react-router-dom';
import './App.css';

function App() {
    const [isLoggedIn,setIsLoggedIn] = useState(false);

    function fetctUsers(name,password){
        fetch('https://pacific-tundra-98620.herokuapp.com/users/' + name + "/" + password)
        .then((response) => {
            console.log(response);
            var data = response.json();
            var p = Promise.resolve(data);
             p.then(function(values) {
                console.log(values)

             });
        })
    }

    const clickHandler = (event) => {
        event.preventDefault();
        console.log(event.target.email.value);
        console.log(event.target.pass.value);
        const name = event.target.email.value;
        const password = event.target.pass.value;
        setIsLoggedIn(true);
        fetctUsers(name,password);
    }


    return (
      <div className="App">
        <Router>
          <Switch>
            <AuthContext.Provider
              value={{
                isLoggedIn: isLoggedIn,
              }}
            >
                <div className="" style={{position:"absolute",left:"0",right:"0"}}>
                  <div class="navbar-container gps-dashboard">
                      <Navbar />
                  </div>
                  <div class="navbar-container gps-navbar">
                      <Navbar_2/>
                  </div>
                  <div class="projects-part">
                    <Route path = '/main' exact>
                      <Project />
                    </Route>
                    <Route path = '/project-details/:name/:country/:city'>
                      <ProjectDetails />
                    </Route>
                    <Route path = "/newPage">
                      <NewPage />
                      <span style={{color:"#6a197d",position:"absolute",left:"37%",fontFamily: "'Noto Sans JP', sans-serif",fontSize:"2rem"}}>Page Under Development</span>
                    </Route>
                    <Route path = '/' exact>
                      <Login />
                    </Route>
                  </div>
                </div>
             </AuthContext.Provider>
          </Switch>
        </Router>
      </div>
    );
}

export default App;
